import React from "react";

function PlaceWithBtn() {
  return (
    <div className="PlaceWithBtn">
        <div>
            <button name="modify">재추천</button>
            <button name="delete">삭제</button>
        </div>
      <div id="image">
        <img src={placeData.thumbnail} alt="no Img" />
      </div>
      <div className="placeinfo">
        <div id="name">{placeData.title}</div>
        <div id="address">- {placeData.address}</div>
      </div>
    </div>
  );
}

export default PlaceWithBtn;
